import './App.css';
import React from 'react'
import Canvas from './components/Canvas'


function App() {
  const draw = (ctx, frameCount) => {
    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height)
    ctx.strokeStyle = '#AAAAAA'
    ctx.beginPath()
    ctx.arc(90, 100, 40, -Math.PI, Math.sin(frameCount*0.05)*Math.PI)
    if(frameCount === 20) {
      frameCount = 0;
    }
    ctx.stroke()
  }

  return (
    <div className="App">
      <div className="top"></div>
      <Canvas draw={draw} />
    </div>
  );
}

export default App;
